  KEY `order_car_manager_id_fk` (`car_manager_id`),
  CONSTRAINT `order_car_manager_id_fk` FOREIGN KEY (`car_manager_id`) REFERENCES `car_manager` (`id`),
  CONSTRAINT `order_customer_id_fk` FOREIGN KEY (`customer_id`) REFERENCES `customer` (`id`),
