	insert into order_log
    set 
        order_log.order_id = NEW.id,
        
        order_log.after_delivery_time1 = NEW.delivery_time1,
        order_log.after_delivery_time2 = NEW.delivery_time2,
        order_log.after_delivery_address = NEW.delivery_address,
        order_log.after_delivery_smallpack_building_id = NEW.delivery_smallpack_building_id,
        order_log.after_delivery_smallpack_fill_address = NEW.delivery_smallpack_fill_address,
        order_log.after_status_id = NEW.status_id,
        order_log.after_modifier = NEW.modifier,

        order_log.loading_driver_id = NEW.loading_driver_id,
        order_log.giving_driver_id = NEW.giving_driver_id,
        order_log.cost = NEW.cost,

        order_log.before_delivery_time1 = OLD.delivery_time1,
        order_log.before_delivery_time2 = OLD.delivery_time2,
        order_log.before_delivery_address = OLD.delivery_address,
        order_log.before_delivery_smallpack_building_id = OLD.delivery_smallpack_building_id,
        order_log.before_delivery_smallpack_fill_address = OLD.delivery_smallpack_fill_address,
        order_log.before_status_id = OLD.status_id,
        order_log.before_modifier = OLD.modifier;
END */;;
